{"source":{"uri":"features/specs/cart.feature","data":"#language: pt \n\n@regression\n@cart \nFuncionalidade: Carrinho\nComo usuário do e-commerce Your Logo\nQuero poder utlizar as funcionalidades do carrinho com sucesso\nPara poder ter uma experiência agradável com a aplicação\n\n    Contexto: \n    Dado que escolha-se um produto para estar na página do carrinho \n   \n    @delete_product_cart\n    Cenário: Excluir produto do carrinho\n        Quando excluir um produto do carrinho\n        Então o produto deverá desaparecer da página do carrinho","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/checkout.feature","data":"#language: pt \n\n@regression\n@checkout\nFuncionalidade: Checkout \nComo usuário do e-commerce Your Logo\nQuero poder prosseguir com o Checkout\nPara realizar a compra\n\n    Contexto: \n        Dado que o usuário adicionou um produto no carrinho\n\n    @payment_bank\n    Esquema do Cenário: validar pagamento via transferência \n        Quando logar com \"<email>\" e \"<senha>\" válidos\n        E escolher um endereço para entrega \n        E escolher o tipo de entrega \n        E selecionar a forma de pagamento via transferência \"<via_bank>\"\n        Então o usuário clicará em I confirm my order e realizará a compra\n    \n     Exemplos:\n\n    |           email          |    senha     |               via_bank              |\n    |     teste123@gmail.com   |   123456     |          Pay by bank wire           |\n\n    \n    @payment_check\n    Esquema do Cenário: Validar pagamento via cheque\n        Quando logar com \"<email>\" e \"<senha>\" válidos\n        E escolher um endereço para entrega \n        E escolher o tipo de entrega \n        E selecionar a forma de pagamento via cheque \"<via_check>\"\n        Então o usuário clicará em I confirm my order e realizará a compra\n    \n     Exemplos:\n\n    |           email          |    senha    |               via_check            |\n    |     teste123@gmail.com   |   123456    |             Pay by check           |\n\n\n    ","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/login.feature","data":"#language: pt\n\n@regression\n@login\n\nFuncionalidade: Login\nComo usuário do e-commerce Your Logo\nQuero poder fazer o login no site\nPara realizar compras\n\n    Contexto:\n        Dado que esteja na página do login\n\n    @invalid_login\n    Esquema do Cenário: Login Inválido\n        Quando o usúario tentar login com \"<email>\" ou \"<senha>\" inválidos\n        Então deverá ser exibida a \"<msg>\"\n\n    Exemplos:\n\n    |           email          |    senha    |               msg             |\n    |                          |   123456    |  An email address required.   |\n    |    teste123@gmail.com    |             |  Password is required.        |\n    |    teste123@gmail.com    |   ABCDEF    |  Authentication failed.       |\n\n    @valid_login\n    Esquema do Cenário: Login Válido\n        Quando o usúario tentar login com \"<email>\" ou \"<senha>\" válidos\n        Então deverá ser direcionado a página My Account com a \"<msg>\" de boas vindas\n\n        Exemplos:\n\n    |           email          |    senha    |                                          msg                                                 |\n    |    teste123@gmail.com    |   123456    |  Welcome to your account. Here you can manage all of your personal information and orders.   |\n  \n    @recuperacao_senha_invalida\n    Esquema do Cenário: Recuperação de senha sem sucesso\n        Quando o usuário clicar no botão Forgot your password?\n        E for redirecionado a página de Forgot Your Password\n        E tentar recuperar a senha com \"<email>\" \n        Então visualizará a \"<msg>\"\n\n    Exemplos:\n\n    \n    |           email          |                         msg                                  |\n    |                          |  Invalid email address.                                      |\n    |    teste123              |  Invalid email address.                                      |\n    |    teste123@oi.com       |  There is no account registered for this email address.      |\n\n    @recuperacao_senha_valida \n    Esquema do Cenário: Recuperação de senha com sucesso\n        Quando o usuário clicar no botão Forgot your password?\n        E for redirecionado a página de Forgot Your Password\n        E tentar recuperar a senha com \"<email>\" \n        Então visualizará a \"<msg>\" comprovando sucesso \n\n    Exemplos:\n\n    \n    |           email          |                                   msg                                    |\n    |    teste123@gmail.com    |  A confirmation email has been sent to your address: teste123@gmail.com  |\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/product.feature","data":"#language: pt \n\n@regression\n@product\nFuncionalidade: Página do Produto\nComo usuário do e-commerce Your Logo\nQuero poder personalizar meus produtos\nPara ficar satisfeita com o produto a ser comprado\n\n    Contexto: \n    Dado que esteja na página do produto\n\n    @change_quantity\n    Cenário: Alterar a quantidade do produto\n        Quando alterar a quantidade de um produto na PDP\n        Então deverá ser exibido a quantidade alterada do produto\n\n    @change_color\n    Cenário: Alterar cor do produto\n        Quando trocar a cor do produto na PDP\n        Então a imagem do produto deverá ser alterada \n    \n    @change_size\n    Cenário: Alterar o tamanho do produto\n        Quando trocar o tamanho do produto na PDP\n        Então o tamanho do produto deverá ser alterado \n\n    @add_to_cart\n    Esquema do Cenário: Adicionar ao carrinho através da PDP\n        Quando adicionar um produto ao carrinho \n        Então deverá ser adicionado com sucesso \"<msg>\"\n\n    Exemplos:\n    |                    msg                         |\n    |Product successfully added to your shopping cart|\n\n        ","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/register.feature","data":"#language: pt\n\n@regression\n@register \n\nFuncionalidade: Cadastro\nComo usuário do e-commerce Your Logo\nQuero poder fazer o cadastro no site\nPara realizar compras\n\n    Contexto:\n        Dado que esteja na página de Authentication do e-commerce em questão\n\n    @invalid_register\n    Esquema do Cenário: Fazer um cadastro inválido na página de autenticação\n        Quando o usúario cadastrar um e-mail inválido\n        Então haverá a mensagem do problema \"<problem>\"\n\n        Exemplos:\n\n        |                                          problem                                                                                  |   \n        |       An account using this email address has already been registered. Please enter a valid password or request a new one.        |  \n\n    \n    @incorrect_register\n    Esquema do Cenário: Fazer um cadastro incorreto na página de autenticação\n        Quando o usúario cadastrar um e-mail válido\n        E a página for redirecionada para YOUR PERSONAL INFORMATION\n        E os dados não forem registrados corretamente\n        Então haverá a mensagem do erro \"<errors>\"\n\n        Exemplos:\n\n        |            errors             |   \n        |      There are 8 errors       |  \n    \n    @valid_register\n    Esquema do Cenário: Fazer um cadastro válido na página de autenticação\n        Quando o usúario cadastrar um e-mail válido\n        E a página for redirecionada para YOUR PERSONAL INFORMATION\n        E os dados forem preenchidos corretamente\n        Então o usuário terá realizado o cadastro com sucesso \"<sucesso>\"\n        \n        Exemplos:\n\n        |                                          sucesso                                                      |   \n        |       Welcome to your account. Here you can manage all of your personal information and orders.       |  ","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/search.feature","data":"#language: pt\n\n@regression\n@search\n\nFuncionalidade: Busca\nComo usuário do e-commerce Your Logo\nQuero poder buscar por produtos\nPara conseguir realizar minhas compras\n\n    Contexto:\n        Dado que esteja na Home\n\n    @search_product\n    Cenário: Busca por produto \n        Quando o usúario buscar um produto na barra de pesquisa\n        Então deverá ser exibido resultados da busca\n\n    @search_other_products\n    Esquema do Cenário: Busca por diferentes produtos\n        Quando o usúario buscar por \"<produtos>\" na barra de pesquisa\n        Então deverá ser exibido resultados da busca\n\n    Exemplos:\n\n    |         produtos         |    \n    |         blouses          |          \n    |         t-shirts         |  \n\n#primeira: vestidos\n#segunda: blusas\n#terceira: camisetas","mediaType":"text/x.cucumber.gherkin+plain"}},
